var u={p:'" filterUnits="objectBoundingBox" x="0%" y="0%" width="100%" height="100%"><feFlood flood-color="',I:'<svg width="0" height="0" style="position:absolute"><filter id="_fcf',n:"A disorder in which nerve cell activity in the brain is disturbed, causing seizures. Epilepsy may occur as a result of a genetic disorder or an acquired brain injury, such as a trauma or stroke. During a seizure, a person experiences abnormal behavior, symptoms and sensations, sometimes including loss of consciousness. There are few symptoms between seizures.Epilepsy is usually treated by medication and in some cases by surgery, devices or dietary changes.",H:'A doctor implants electrodes in certain areas of your brain. The impulses they cause restrict other impulses that can cause the disease.  A device that acts like a pacemaker goes under the skin in your chest to control the impulses. A wire runs beneath your skin from the device to the "lead" in your brain.\n\nDBS is only recommended after consultation with a Neuro Surgeon and when medicine isn\'t working. Talk with your doctor to see if this is right for you.\n\nDBS is used to treat the following Conditions:\n\n1.Movement disorders like Parkinson\u2019s disease, dystonia, essential tremor \n2.Some types of autism especially those with severe aggressive behaviour. \n3.Some psychiatric problems like depression, OCD, Tourette\u2019s syndrome.\n4.Intractable addiction/ alcoholism \n5.Intractable epilepsy \n6.Intractable obesity\n7.Chronic pain especially the central post stroke pain\n8.Selected cases of Schizophrenia\n9.Cases of patients in coma (persistent vegetative state)',o:'A doctor implants electrodes in certain areas of your brain. The impulses they cause restrict other impulses that can cause the disease. A device that acts like a pacemaker goes under the skin in your chest to control the impulses. A wire runs beneath your skin from the device to the "lead" in your brain. DBS is only recommended after consultation with a Neuro Surgeon and when medicine isn\'t working. Talk with your doctor to see if this is right for you. Doctors still do Thalamotomy and Pallidotomy surgeries, but they happen less frequently because of the risk of serious side effects and both the methods have proven to be less effective and reliable in most of the patients.  It\u2019s a risk of chance & luck.',q:"A serious developmental disorder that impairs the ability to communicate and interact.\n\nAutism spectrum disorder impacts the nervous system and affects the overall cognitive, emotional, social and physical health of the affected individual.\n\n The range and severity of symptoms can vary widely. Common symptoms include difficulty with communication, difficulty with social interactions, obsessive interests and repetitive behaviors.\n\n Early recognition, as well as behavioral, educational and family therapies may reduce symptoms and support development and learning.",a:"Can all patients who are suffering from Epilepsy be cured?",E:"Deep brain stimulation (DBS) is a treatment approach that involves stereo tactical surgical implantation of electrical leads into specific deep brain targets to provide, from an external generator, focal electrical neural network modulation. It historically evolved from stereotactic ablation/lesioning neurosurgery, but is preferred because the stimulation is adjustable and can be individualized to optimize benefits and minimize side effects and the stimulation can be turned off if needed.",F:"Does Deep Brain Stimulation require a long-time hospitalization?",C:"Does Epilepsy treatment require a prolonged hospitalization?",R:"Dr R Ramnarayan is a World Renowned Neurosurgeon who has set his foot prints across the globe. Specialised in Restorative Neurosurgery, Dr Ramnarayan has over 500 plus successful specialised restorative neurosurgeries under his credentials. Dr Ramnarayan focuses only on these specialised restorative neurosurgeries and so is able to generate good results repeatedly. Dr Ramnarayan provides his expertise in providing international standard care to the patients to help them lead a normal life for the patients suffering from Chronic health issues. With his expertise of over 25 years across various countries Dr Ramnarayan has touched the life of various individuals who had been left bedridden for their life to rehabilitate and lead a normal life pursuing their dreams.",_:"How much time does it take for a DBS Surgery?",B:'Intrathecal drug delivery, also known as the "pain pump," uses a small pump to deliver pain medication directly to your spinal cord. The pump is surgically placed under the abdominal skin and delivers pain medication through a catheter to the area around your spinal cord.\n\n\'Intrathecal Drug Delivery Systems is used to treat the following conditions:\n\n1.Cancer pains\n2.Failed back surgery syndromes (Post laminectomy syndrome).\n3.Other types of noxious pain like osteoporotic pain, rheumatoid arthritis.\n4.All types of spasticity (stiffness of hands and legs) as in:',S:"Is the Deep Brain Stimulation Surgery a life risking one?",T:"Most of the cases the Parkinson\u2019s disease is treated with drugs. When drugs become ineffective over a period of time and the symptoms are becoming severe, surgery is the only remedy to provide rehabilitation to the patient from their suffering. \u201cDeep Brain Stimulation\u201d is the best surgical method available at this point of time for Parkinson\u2019s patients who are looking at a relief from this Disease?",L:"No. The patient requires a maximum of 2-3 days of hospitalization.",Y:"No. The surgery is absolutely safe when performed by expert Neuro Surgeon. It can permanently disable a patient, if the surgery goes wrong or done under the supervision of a non-experienced Neuro Surgeon.",r:"No. The surgery takes an approximate 14 hours timeframe to complete. The patient would not require more than 3 days of hospitalization, that includes pre and post-surgical procedures.",D:"Parkinson's disease is a brain disorder that leads to shaking, stiffness, and difficulty with walking, balance, and coordination. Parkinson's symptoms usually begin gradually and get worse over time. As the disease progresses, people may have difficulty walking and talking.\n\nA disorder of the central nervous system that affects movement, often including tremors. Nerve cell damage in the brain causes dopamine levels to drop, leading to the symptoms of Parkinson's.",g:"Parkinson\u2019s can be controlled but not cured completely.  \u201cDeep Brain Stimulation\u201d can provide rehabilitation to a very large extent to most of the patients. This however can be done only based on the consultation with Expert Neuro Surgeons after a thorough consultation & examination.",K:"Please consult your Neuro Surgeon for the right advice. Depending on your clinical inspection and reports, your Neuro Surgeon can suggest you the best method that can help you recover.",y:"SS Hospitals is a Specialized Neuro Rehabilitative Centre.  The first of its kind in Asia to provide Neuro Rehabilitative Surgeries that provide a new leaf of life to the several disabled people.  Dr Ramnarayan is a Globally renowned Neuro Surgeon Specialized in Rehabilitative Neuro Surgery.  He has provided a new life to over 500+ patients who have been disabled with Parkinson's, Epilepsy, Autism, Chronic Pain, Failed Back Surgery Syndromes, Patients in Persistent Vegetative Stage and many more... ",i:"SS Hospitals is established with a vision of providing world class health care at an affordable cost.SS Hospitals aims at being the Global Hub for Rehabilitative Neuro Surgery & Restorative Neuro Surgery.",W:"Sacral Neuromodulation (SNM) (also known as Sacral Nerve Stimulation) is a therapy that may be able to help certain people who experience bladder and bowel problems.  While successful, the treatment can be a life changing therapy. As with all treatments, it is not suitable for everyone and your doctor or specialist healthcare professional will be able to discuss its potential suitability for you, or those you care for.\n\nIt delivers gentle electrical impulses through a probe (a thin wire) that is placed near the sacral nerve. The technology is similar to a pacemaker, but instead of regulating a person's heartbeat, it stimulates the bowel, sphincter and bladder muscles to work normally.\n\nSacral Nerve Stimulation is done for conditions like:",j:"So, should I undergo DBS or VNS for Epilepsy disorder?",U:"Spinal cord stimulation therapy masks pain signals before they reach the brain. A small device, similar to a pacemaker, delivers electrical pulses to the spinal cord. It helps people better manage their chronic pain and reduce their use of opioid medications. It may be an option if you suffer chronic back, leg or arm pain and have not found relief with other therapies.\n\nA spinal cord stimulator (SCS) device is surgically placed under your skin and sends a mild electric current to your spinal cord. Thin wires carry current from a pulse generator to the nerve fibers of the spinal cord. When turned on, the SCS stimulates the nerves in the area where your pain is felt. Pain is reduced because the electrical pulses modify and mask the pain signal from reaching your brain.\n\n Spinal Cord Stimulation is done for Conditions like:",V:"Stream has been disposed.\nAn ImageStream is considered disposed once at least one listener has been added and subsequently all listeners have been removed and no handles are outstanding from the keepAlive method.\nTo resolve this error, maintain at least one listener on the stream, or create an ImageStreamCompleterHandle from the keepAlive method, or create a new stream for the image.",J:"SystemChrome.setApplicationSwitcherDescription",c:"The element being rebuilt at the time was index ",s:"The goal of treatment is to maximize your child's ability to function by reducingautism spectrum disorder symptoms and supporting development and learning. Early intervention during the preschool years can help your child learn critical social, communication, functional and behavioral skills",h:"The surgery takes approximately 14 Hours\u2019 time to be completed.",u:"There was a problem trying to load FontManifest.json",v:"There's no cure for epilepsy, but the disorder can be managed with medications and other strategies. While the medicines do not work, Deep Brain Stimulation (DBS) or Vagal Nerve Stimulation is found to be highly effective. These Surgeries control and in a few cases could abolish the seizures totally. In DBS the area of the brain called anterior nucleus of the thalamus is stimulated. In Vagal Nerve Stimulation, the Vagus nerve in the neck is stimulated.\n\nVagal nerve also called the tenth cranial nerve is the nerve which arises from the brain and goes into the body to control the heart, intestines and other abdominal organs. It is seen very prominently in the neck. There are two conditions where stimulating the vagal nerve produces very good results. One is in uncontrolled seizures and the second is in severe treatment resistant depression. The surgery is done in the neck and usually takes less than two hours. It is approved by the USFDA.",k:"This can only be confirmed from a clinical study of the patient. Though in a few cases there has been records of complete seizure of epilepsy, not all patients have found a complete cure. However there has been tremendous improvement in their epileptic seizures for the patients who have undergone DBS surgery or the Vagal Nerve stimulation.\n\nSS Hospital offers Ayurvedic massage treatments to the patients who have undergone DBS or Vagal Nerve Stimulation for a higher, better and quicker recovery.",P:"Vagus Nerve Stimulation (VNS) is a medical treatment that involves delivering electrical impulses to the Vagus nerve. It is used as an add-on treatment for certain types of intractable epilepsy and treatment-resistant depression.\n\nVagus Nerve Stimulation is done for condition like:",X:"What are the Treatments available for Autism?",G:"What are the Treatments available for Parkinson\u2019s Disease?",A:"What is Deep Brain Stimulation?  Are there other alternative Surgeries available?",b:"What is Deep Brain Stimulation? Are there other alternative Surgeries available?",O:"While DBS helps the child regain an almost normal life, over a period of time, psychological counselling and ayurvedic massages helps the child rehabilitate much quickly and more efficiently. SS Hospitals provides a combination of DBS & Ayurvedic treatment for the Autism patients to recover & rehabilitate more quickly.",z:"While there is no complete &amp; permanent Cure for Autism, worldwide research has shown that Certain interventions can show a good rehabilitation in the Child who is suffering with Autism. DBS \u2013 Deep Brain Stimulation has shown tremendous improvement in controlling the aggressive behavior of children with Autism. With time, the DBS process has also shown improvement in the autism features.",Q:"Will DBS alone help my child come out of Autism?",M:"\u2022  Cerebral palsy\n\u2022  Hypoxic encephalopathy (such as drowning, smoke inhalation)\n\u2022  Multiple Sclerosis\n\u2022  Severe head injury\n\u2022  Spinal cord injury\n\u2022  Stroke\n\u2022  Some Neurodegenerative illness ",N:"\u2022  Refractory. angina/ Intractable heart Failure (Class 3 and 4)\n\u2022  Patients with failed back surgery syndrome\n\u2022  Patients with severe painful diabetic neuropathy\n\u2022  Patients with brachial plexus injury pain\n\u2022  Patients with severe peripheral vascular disease (limb saving)\n\u2022  Some cases of persistent vegetative state",Z:"\u2022  Uncontrolled epilepsy\n\u2022  Uncontrolled depression including suicidal tendency",d:"\u2022  Urinary incontinence due to nervous diseases\n\u2022  Urinary retention (non-Obstructive) due to nervous diseases\n\u2022  Faecal incontinence due to nervous diseases\n\u2022  Constipation due to nervous diseases\n\u2022  Some cases of irritable bowel syndrome\n\u2022  Pelvic pain in women"}
